import React, { useEffect, useState } from "react";
import axios from "axios";
import { Card, CardTitle, CardBody } from "@progress/kendo-react-layout";
import "../pages.css";
import keys from "../../config/keys";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faAddressCard } from "@fortawesome/free-solid-svg-icons";

const Contact = () => {
  const [data, setData] = useState({});
  const url = keys.backendURI + "/api/contact";
  useEffect(() => {
    const fetchData = async () => {
      const result = await axios(url);
      setData(result.data.data[0]);
    };
    fetchData();
  }, []);

  return (
    <div className="component-section">
      <div className="content-heading">CONTACTS</div>
      <div className="card-content">
        <Card
          style={{
            margin: 100,
            marginLeft: 100,
            marginTop: 100,
            borderWidth: 2,
          }}
        >
          <CardBody className="card-body">
            <CardTitle>
              <h2>How to contact me</h2>
              <hr />
            </CardTitle>
            <br />
            <div className="contacts">
              <FontAwesomeIcon className="icons" icon={faAddressCard} />
              <span>
                <h2>Email Id :- {data.gmail}</h2>
              </span>
              <h2>LinkedIn Profile :- {data.linkedIn}</h2>
              <h2>Github Profile :- {data.github}</h2>
            </div>
          </CardBody>
        </Card>
      </div>
    </div>
  );
};

export default Contact;
